import { CARDS, TEXT_TYPE } from "../config/variables";

class VariableService {
  getCardImages() {
    return CARDS;
  }
  getTextType() {
    return TEXT_TYPE;
  }
  getLabels() {
    return TEXT_TYPE;
  }
}

export default new VariableService();
